class Home extends Component{

  state = {
    posts : [] 
  }
  

componentDidMount(){




axios.get('https://jsonplaceholder.typicode.com/photos')
.then(response => {
 // console.log(response.data.slice(0,8));

this.setState({
    posts :  response.data.slice(0,8)
    });

    console.log(this.state.posts);
  } 
 );



}


